import style from "../Courses.module.css";
function StepType(props) {
  return (
    <div>
      <div>Type</div>
      <div className={style.type}>
        <select
          value={props.stepType}
          onChange={(evt) => props.setStepType(evt.target.value)}
        >
          <option>Text</option>
          <option>Video</option>
          <option>Test</option>
        </select>
      </div>
    </div>
  );
}

export default StepType;
